import {createBrowserRouter} from "react-router-dom";
import 'sweetalert2';

import LOGIN from "../Components/Page/Login/Login";
import PROFILE_PAGE from "../Components/Page/Profile/Profile";
import PAGE_PATIENT_LIST from "../Components/Page/Login/Patient-list";
import ROOT from "../Components/Root/Root";
import HOEM from "../Components/Page/Home/Home";
import SERVICE_DETAIL from "../Components/Page/Page-service/Service-detail";
import ERROR_PAGE from "../Components/Error-page/Error-page";

import FOOD_MENU from '../Components/Page/Food-menu/Food-menu';
import FOOD_DETAIL from '../Components/Page/Food-menu/Food-detail/Food-detail';

import BASKET from '../Components/Page/Food-menu/Basket/Basket';
import STATUS_DETAIL from '../Components/Page/Status-detail/Status-detail';

import RELOAD from '../Components/Page/Reload-page/Reload-page';

// MASTER
import ROOT_MASTER from '../Components/Page/Setting/Root/Root';
import ADD_INGREDIENT_GROUP from '../Components/Page/Setting/Page/Ingredient-group/Ingredient-group';
import ADD_INGREDIENT_GROUP_EDIT from '../Components/Page/Setting/Page/Ingredient-group/Edit/Ingredient-group-edit';
import ADD_MENU_TYPE from '../Components/Page/Setting/Page/Menu-type/Menu-type';
import ADD_FOOD from '../Components/Page/Setting/Page/Add-food/Add-food';
import EDIT_FOOD from '../Components/Page/Setting/Page/Add-food/Edit-food/Edit-food';
import MENU_LIST from '../Components/Page/Setting/Page/Menu-list/Menu-list';
import PAGE_QR_MST from "../Components/Page/Setting/Page/Qr-mst/Qr-mst";

// import ADD_MENU_TYPE from '../Components/Page/Setting/Page/Menu-type/Menu-type';

import { HOME_PAGE_LOCAL, MASTER_PAGE_LOCAL } from "../Components/API/API";


export const router = createBrowserRouter([
  {
    path: `${HOME_PAGE_LOCAL}`,
    element: <LOGIN />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Profile`,
    element: <PROFILE_PAGE />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Patient-list`,
    element: <PAGE_PATIENT_LIST />
  },
  {
    path: `${HOME_PAGE_LOCAL}`,
    element: <ROOT />,
    errorElement: <ERROR_PAGE />,
    children: [
      // {
      //   path: `${HOME_PAGE_LOCAL}`,
      //   element: <HOEM />
      // },
      {
        path: `${HOME_PAGE_LOCAL}/Home`,
        element: <HOEM />
      },
      {
        path: `${HOME_PAGE_LOCAL}/Service`,
        element: <SERVICE_DETAIL />,
        children: [
          {
            path: ":PageName",
            element: <SERVICE_DETAIL />
          }
        ]
      },
    ],
  },
  {
    path: `${HOME_PAGE_LOCAL}/Service/Food-service/:Menu`,
    element: <FOOD_MENU />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Service/Food-service/:Menu/:FoodId`,
    element: <FOOD_DETAIL />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Service/Food-service/:Menu/Basket`,
    element: <BASKET />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Service/Status-detail`,
    element: <STATUS_DETAIL />
  },
  {
    path: `${HOME_PAGE_LOCAL}/Reload-page`,
    element: <RELOAD />
  },

  // PAGE SETTING
  {
    path: `${MASTER_PAGE_LOCAL}`,
    element: <ROOT_MASTER />,
    children: [

      {
        path: `${MASTER_PAGE_LOCAL}/Ingredient-group`,
        element: <ADD_INGREDIENT_GROUP />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/Ingredient-group-edit`,
        element: <ADD_INGREDIENT_GROUP_EDIT />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/Menu-type`,
        element: <ADD_MENU_TYPE />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/Add-food`,
        element: <ADD_FOOD />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/Edit-food`,
        element: <EDIT_FOOD />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/Food-list`,
        element: <MENU_LIST />
      },
      {
        path: `${MASTER_PAGE_LOCAL}/QR-code-mst`,
        element: <PAGE_QR_MST />
      }

    ],
  },


]);
